features:
  versions:
    - HTTP_VERSION_1
  protocols:
    - PROTOCOL_CONNECT
  codecs:
    - CODEC_PROTO
    - CODEC_JSON
  compressions:
    - COMPRESSION_IDENTITY
    - COMPRESSION_GZIP
    - COMPRESSION_BR
  stream_types:
    - STREAM_TYPE_UNARY
  supports_half_duplex_bidi_over_http1: false
  supports_h2c: false
  supports_tls: false
  supports_tls_client_certs: false
  supports_trailers: true
  supports_connect_get: false
  supports_message_receive_limit: false
